	(9, 6417, NULL, 'Choose Your Freebie: Get a FREE Champ or a FREE Chicken a la King Pie Trio', 'Make your meals even MORE joyful with MORE freebies to choose from!\r\n\r\nGet a FREE Champ or a FREE Chicken a la King Pie Trio with a min. order of P650 for registered users!\r\n\r\nCatch these App Exclusive deals from September 1 ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ October 31, 2022', 'promo', 'uploads/media/brand/products/promo-1.jpg', 'uploads/media/brand/products/promo-1.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 00:58:31', '2023-02-02 05:43:16', '2023-02-02 05:43:16'),
	(10, 6417, NULL, 'Welcome Gift: Get a FREE Peach Mango Pie 3 Pies To-Go', 'Your Welcome Gift is waiting!\r\n\r\nGet a FREE Peach Mango 3 Pies To-Go with a min. purchase of P400 for first-time users! \r\n\r\nCatch this App Exclusive deal from September 1 ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ October 31, 2022.', 'promo', 'uploads/media/brand/products/promo-2.jpg', 'uploads/media/brand/products/promo-2.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:01:05', '2023-02-02 05:43:13', '2023-02-02 05:43:13'),
	(11, 6417, NULL, 'Jollibee Plush Doll Novelty Promo', 'Get Jollibee Plush Doll for only P275 with any food purchase.\r\n\r\nPromo period is from August 15 ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ December 31, 2022.\r\n\r\nValid for dine-in, take out, drive-thru and delivery via #87000.\r\n\r\nAvailable at participating Jollibee stores only.\r\n\r\nCannot be used in conjunction with other promos.\r\n\r\nIn the purchase of goods and services which are on promotional discounts, the senior citizen can avail of the establishmentÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s offered discount or the 20 percent discount provided under Expanded Senior Citizens Act of 2010, whichever is higher and more favorable.', 'promo', 'uploads/media/brand/products/promo-3.jpg', 'uploads/media/brand/products/promo-3.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:02:47', '2023-02-02 05:43:11', '2023-02-02 05:43:11'),
	(12, 6417, NULL, 'Funko Champ', 'Jollibee launches another Funko exclusive toy with a punch!\r\n\r\nGet the limited edition Jollibee Funko Champ for P650 when you order any Champ or Champ Jr. via the Jollibee App. Enjoy it with a limited edition Champ Sleeve when you order Champ ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ Solo or Champ w/ Fries! Promo runs from Oct 1 ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ 15, 2022 extended until November 30, 2022.', 'promo', 'uploads/media/brand/products/promo-4.jpg', 'uploads/media/brand/products/promo-4.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:05:14', '2023-02-02 05:43:07', '2023-02-02 05:43:07'),
	(13, 6417, NULL, '10.10 Jollibee App Exclusive Deal!', 'Adding to your cart has never been this joyful with the Jollibee App Exclusive 10.10 Deal! \r\n\r\nGet a FREE Chicken Sandwich for a min. order of P500 in delivery! Promo runs from Oct 10-12.\r\n\r\nWhat are you waiting for? Grab this deal now!', 'promo', 'uploads/media/brand/products/promo-5.jpg', 'uploads/media/brand/products/promo-5.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:30:37', '2023-02-02 05:43:03', '2023-02-02 05:43:03'),
	(14, 6417, NULL, 'No Tricks, Just Jolly Treats Promo', 'Visit your favorite Jollibee store in your Halloween costume and get a special treat with any food purchase this October 29 ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ 30 from 1pm to 4pm.\r\n\r\nDTI Fair Trade Permit No. FTEB-153535 Series of 2022', 'promo', 'uploads/media/brand/products/promo-6.jpg', 'uploads/media/brand/products/promo-6.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:37:13', '2023-02-02 05:43:05', '2023-02-02 05:43:05'),
	(15, 6417, NULL, 'Bench x Jollibee Love Pinoy Shirts Promo', 'Promo is from October 29 ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ November 4, 2022.\r\n\r\nAvailable only via Jollibee App on October 29.\r\n\r\nAvailable via dine-in, take out, drive-thru and delivery via #87000 hotline, Jollibee App and website from October 30 ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ November 4.\r\n\r\nCannot be sold separately and without food purchase.\r\n\r\nAvailable at participating Jollibee stores only.\r\n\r\nCannot be used in conjunction with other promos.\r\n\r\nAvailable in two designs. Free size only.\r\n\r\nIn the purchase of goods and services which are on promotional discounts, the Senior Citizen can avail of the establishmentÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s offered discount, or the 20 percent discount provided under Expanded Senior Citizens Act of 2010, whichever is higher and more favorable.\r\n\r\nDTI Fair Trade Permit No. FTEB ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ 152840, Series of 2022', 'promo', 'uploads/media/brand/products/promo-7.jpg', 'uploads/media/brand/products/promo-7.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:38:18', '2023-02-02 05:43:01', '2023-02-02 05:43:01'),
	(16, 6417, NULL, 'Jollibee Sarap ng Pasko Big Order Service (JSPB) Program', 'Book your Christmas party now and avail of the 10% giftback* for a minimum single-receipt food purchase worth P5,501.\r\n\r\nOffer is valid for bookings from November 15 to December 31, 2022.\r\n\r\nApplicable only to select Christmas bundles, Jolly Kiddie Meals, and solo food items.\r\n\r\nBig order is available via dine-in, take out and delivery via #87000 hotline.\r\n\r\nAvailable at participating Jollibee stores nationwide.\r\n\r\nCannot be used in conjunction with other promos.\r\n\r\nIn the purchase of goods and services which are on promotional discounts, the Senior Citizen can avail of the establishmentÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s offered discount, or the 20 percent discount provided under Expanded Senior Citizens Act of 2010, whichever is higher and more favorable.\r\n\r\nDTI Fair Trade Permit No. FTEB-154670 Series of 2022.\r\n\r\n*Giftback may be in a form of Jollibee Gift Certificates or products, whichever may be availed by the customer and requested through the JSPB-serving store.', 'promo', 'uploads/media/brand/products/promo-8.jpg', 'uploads/media/brand/products/promo-8.jpg', '2022-11-01', '2022-11-30', 0, 1, '2022-11-16 01:39:42', '2023-02-02 05:42:59', '2023-02-02 05:42:59'),
	(17, 6417, NULL, '11.11 Jollibee App Exclusive Deal!', 'Add joy to your cart this 11.11 with a free Peach Mango Pie 6 Pies-to-go! Just order at least P500 to make your 11.11 shopping extra sweeter!\r\n\r\nPromo runs from Nov. 11 ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã¢â‚¬Å“ 13, 2022. Full promo mechanics here: https://www.jollibee.com.ph/11-11-deal/\r\n\r\nWhat are you waiting for? Grab this deal now!', 'promo', 'uploads/media/brand/products/promo-9.jpg', 'uploads/media/brand/products/promo-9.jpg', '2022-11-01', '2023-01-31', 0, 1, '2022-11-16 01:44:50', '2023-02-02 05:42:56', '2023-02-02 05:42:56'),
